import React, { useRef, useState } from 'react';
import html2canvas from 'html2canvas';
import { write } from 'clipboard-polyfill';
import "../../assets/styles/secondpage.scss";
import { ToastContainer, toast } from 'react-toastify';

const TenthPage = () => {
    const screenshotRef = useRef(null);
    const [data, setData] = useState({
        time: "15:42",
        amount: "518.31 USDT",
        date: "2023-7-29 15:42:47.",
    });

    const [imageDimension, setImageDimension] = useState("167");

    const onChangeHandler = (e) => {
        setData({ ...data, [e.target.name]: e.target.value });
    }

    const manageTimeDate = () => {
        const now = new Date();
        const currentYear = now.getFullYear();
        const currentMonth = now.getMonth() + 1;
        const currentDay = now.getDay();
        const hours = String(now.getHours()).padStart(2, '0');
        const minutes = String(now.getMinutes()).padStart(2, '0');
        const seconds = String(now.getSeconds()).padStart(2, '0');

        const finalRes = `${currentYear}-${currentMonth}-${currentDay} ${hours}:${minutes}:${seconds}.`
        return setData({
            ...data,
            date: finalRes
        });
    }

    const notify = (message) => toast.success(message, {
        containerId: 'success-toast',
        style: {
            background: 'black',
            color: 'white',
        },
    });

    const takeScreenshot = async () => {
        try {
            const canvas = await html2canvas(screenshotRef.current);
            const dataURL = canvas.toDataURL('image/png');

            const img = new Image();
            img.src = dataURL;

            img.onload = () => {
                const canvas = document.createElement("canvas");
                canvas.width = img.width;
                canvas.height = img.height;

                const context = canvas.getContext("2d");
                context.drawImage(img, 0, 0);

                // Convert canvas to blob
                canvas.toBlob((blob) => {
                    const clipboardItem = new ClipboardItem({ [blob.type]: blob });

                    // Use the clipboard-polyfill to copy the item
                    write([clipboardItem]).then(() => {
                        notify("Copied to clipboard");
                    }).catch((error) => {
                        console.error("Error copying image:", error);
                    });
                }, img.type);
            };
        } catch (error) {
            console.error('Error taking screenshot:', error);
        }
    };

    return (
        <>
            <>
                <div className="billing_childs">
                    <ToastContainer autoClose={1000} />
                    <div className="app-heading">
                        <h3>PREVIEW - <span>Mobile 10</span></h3>
                        <div class="slidecontainer">
                            <button onClick={() => takeScreenshot()}>Screenshot <i className="fa fa-copy"></i></button>
                            <span>{imageDimension + "%"}</span>
                            <input
                                type="range"
                                min="1"
                                max="500"
                                className="slider"
                                name="imageDimension"
                                value={imageDimension}
                                onChange={(e) => setImageDimension(e.target.value)}
                            />
                        </div>
                    </div>
                    <div className="mobile-view-wrapper" >
                        <div className="artboard secondpage_font">
                            <foreignObject ref={screenshotRef}>
                                <svg
                                    xmlns="http://www.w3.org/2000/svg"
                                    xmlnsXlink="http://www.w3.org/1999/xlink"
                                    width={imageDimension + "%"}
                                    viewBox="0 0 1822 3946"
                                >
                                    <defs>
                                        <pattern
                                            id="pattern"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 58 56"
                                        >
                                            <image
                                                width="58"
                                                height="56"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                        <pattern
                                            id="pattern-2"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 370 65"
                                        >
                                            <image
                                                width="370"
                                                height="65"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                        <pattern
                                            id="pattern-3"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 861 159"
                                        >
                                            <image
                                                width="861"
                                                height="159"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                        <pattern
                                            id="pattern-4"
                                            width="100%"
                                            height="100%"
                                            preserveAspectRatio="none"
                                            viewBox="0 0 352 38"
                                        >
                                            <image
                                                width="352"
                                                height="38"
                                                xlinkHref="data:image/png;base64,"
                                            ></image>
                                        </pattern>
                                    </defs>
                                    <g data-name="Group 6" transform="translate(-603 -57)">
                                        <path
                                            fill="#1f2630"
                                            d="M0 0H1822V3946H0z"
                                            data-name="Rectangle 23"
                                            transform="translate(603 57)"
                                        ></path>
                                        <path
                                            fill="url(#pattern)"
                                            d="M0 0H180V174H0z"
                                            data-name="Image 14"
                                            transform="translate(653 314)"
                                        ></path>
                                        <image
                                            width="756"
                                            height="651"
                                            data-name="Image 15"
                                            transform="translate(1136 661)"
                                            xlinkHref="data:image/png;base64,"
                                        ></image>
                                        <path
                                            fill="url(#pattern-2)"
                                            d="M0 0H1092V192H0z"
                                            data-name="Image 16"
                                            transform="translate(968 1312)"
                                        ></path>
                                        <text
                                            fill="#edf0f4"
                                            data-name="518.31 USDT"
                                            fontFamily="Roboto-Bold, Roboto"
                                            fontSize="160"
                                            fontWeight="500"
                                            transform="translate(1539 1656)"
                                        >
                                            <tspan x="0" y="0" textAnchor="middle">
                                                {data.amount}
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#7f8690"
                                            data-name="Estimated completion time: 2023-07-29 15:42:47."
                                            fontFamily="Roboto-Regular, Roboto"
                                            fontSize="55"
                                            transform="translate(1528 3248)"
                                        >
                                            <tspan x="0" y="0" textAnchor="middle">
                                                Estimated completion time: {data.date}
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#7f8690"
                                            data-name="You will receive an email once withdrawal is completed."
                                            fontFamily="Roboto-Regular, Roboto"
                                            fontSize="55"
                                            transform="translate(1528 3346)"
                                        >
                                            <tspan x="-676.543" y="0">
                                                You will receive an email once withdrawal is completed.
                                            </tspan>
                                        </text>
                                        <text
                                            fill="#7f8690"
                                            data-name="View history for the latest updates."
                                            fontFamily="Roboto-Regular, Roboto"
                                            fontSize="55"
                                            transform="translate(1538 3422)"
                                        >
                                            <tspan x="-424.008" y="0">
                                                View history for the latest updates.
                                            </tspan>
                                        </text>
                                        <path
                                            fill="url(#pattern-3)"
                                            d="M0 0H1686V311H0z"
                                            data-name="Image 17"
                                            transform="translate(671 3509)"
                                        ></path>
                                        <path
                                            fill="url(#pattern-4)"
                                            d="M0 0H690V74H0z"
                                            data-name="Image 18"
                                            transform="translate(1169 3910)"
                                        ></path>
                                        <text
                                            fill="#edf0f4"
                                            data-name="15:42"
                                            fontFamily="Roboto-Medium, Roboto"
                                            fontSize="88"
                                            fontWeight="500"
                                            transform="translate(908 208)"
                                        >
                                            <tspan x="-111.697" y="0">
                                                {data.time}
                                            </tspan>
                                        </text>
                                        <image
                                            width="505"
                                            height="202"
                                            data-name="Image 19"
                                            transform="translate(1840 76)"
                                            xlinkHref="data:image/png;base64,"
                                        ></image>
                                    </g>
                                </svg>
                            </foreignObject>
                        </div>
                    </div>
                </div>
                <div className="billing_childs">
                    <div className="app-heading">
                        <h3>CONTROLS</h3>
                    </div>
                    <div className="global_form_wrapper">
                        <div className="global_form_inner">
                            <label>Time</label>
                            <input
                                type="text"
                                value={data.time}
                                name="time"
                                onChange={(e) => onChangeHandler(e)}
                            />
                        </div>
                        <div className="global_form_inner">
                            <label>Amount</label>
                            <input
                                type="text"
                                value={data.amount}
                                name="amount"
                                onChange={(e) => onChangeHandler(e)}
                            />
                        </div>
                        <div className="global_form_inner">
                            <label>Date and time</label>
                            <input
                                type="text"
                                value={data.date}
                                name="date"
                                onChange={(e) => onChangeHandler(e)}
                            />
                            <button className="dateTimeBtn" onClick={() => manageTimeDate()}>Pick Current Date and Time <i className="fa fa-clock"></i></button>
                        </div>
                    </div>
                </div>
            </>
        </>
    )
}

export default TenthPage;